import './App.css';
function NavBar() {
  return (
    <div>
      <header>
        <nav style={{ display: "flex", justifyContent: "space-around", alignItems: "center" }}>
          <a href="#"><img src="https://www.udemy.com/staticx/udemy/images/v7/logo-udemy.svg" alt="Udemy" /></a>
          <p>Explore drop down on hover</p>
          <p>search bar</p>
          <a href="#">plans and pricing</a>
          <a href="#">udemy business on hover</a>
          <a href="#">teach on udemy on hover</a>
          <a href="#">cart on hover</a>
          <button>login</button>
          <button>sign up</button>
          <p>lang pop up</p>
        </nav >
      </header >
    </div >
  );
}
function Sale() {
  return (
    <div>
      <img src="https://img-c.udemycdn.com/notices/web_carousel_slide/image/5ab81bd5-af55-4235-9f1e-07cdc7ce0b93.jpg" alt="" width="1340" height="400"></img>
    </div>
  );
}
function EssentialSkills() {
  return (<div>
  </div>);
}
function AiEra() {
  return (
    <section>
      <div>
        <div>
          <h3>Reimagine your career in the AI era</h3>
          <p>Future-proof your skills with Personal Plan. Get access to a variety of fresh content from real-world experts.</p>
          <ul>
            <li><span>Learn Ai and more</span></li>
            <li><span>Prep for a certification</span></li>
            <li><span>Practice with AI coaching</span></li>
            <li><span><strong></strong></span></li>
          </ul>
        </div>
        <div>

        </div>
      </div>
    </section>
  )
}
function Skills() {
  return (
    <section>
      <h2>Skills to transform your career and life</h2>
      <p>From critical skills to technical topics, Udemy supports your professional development.</p>
      <div>
        <div>
          <button><span>Artificial Intelligence (AI)</span></button>
          <button><span>Python</span></button>
          <button><span>Microsoft Excel</span></button>
          <button><span>A Agents & Agentic Ai</span></button>
          <button><span>Digital Marketing</span></button>
          <button><span>Amazon AWS</span></button>
        </div>
        <div>
//scrollable
        </div>
      </div>
      <a href="https://www.udemy.com/topic/artificial-intelligence/">
        <span>Show all Artificial Intelligence (AI) courses</span>
      </a>
    </section>
  );
}
function Trusted() {
  return (
    <section>
      <div>
        <h2>Trusted by over 17,000 companies and millions of learners around the world</h2>
        <ul>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/3E0eIh3tWHNWADiHNBmW4j/3444d1a4d029f283aa7d10ccf982421e/volkswagen_logo.svg" alt="Volkswagen logo"></img></li>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/2pNyDO0KV1eHXk51HtaAAz/090fac96127d62e784df31e93735f76a/samsung_logo.svg" alt="Samsung logo"></img></li>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/3YzfvEjCAUi3bKHLW2h1h8/ec478fa1ed75f6090a7ecc9a083d80af/cisco_logo.svg" alt="Cisco logo"></img></li>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/23XnhdqwGCYUhfgIJzj3PM/77259d1ac2a7d771c4444e032ee40d9e/vimeo_logo_resized-2.svg" alt="Vimeo logo"></img></li>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/1UUVZtTGuvw23MwEnDPUr3/2683579ac045486a0aff67ce8a5eb240/procter_gamble_logo.svg" alt="Procter &amp; Gamble logo"></img></li>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/1GoAicYDYxxRPGnCpg93gi/a8b6190cc1a24e21d6226200ca488eb8/hewlett_packard_enterprise_logo.svg" alt="Hewlett Packard Enterprise logo"></img></li>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/2tQm6aYrWQzlKBQ95W00G/c7aaf002814c2cde71d411926eceaefa/citi_logo.svg" alt="Citi logo"></img></li>
          <li><img src="https://cms-images.udemycdn.com/96883mtakkm8/7guDRVYa2DZD0wD1SyxREP/b704dfe6b0ffb3b26253ec36b4aab505/ericsson_logo.svg" alt="Ericsson logo"></img></li>
        </ul>
      </div>
    </section>
  );
}
function App() {
  return (
    <NavBar />,
    <main>
      <Sale />
      <EssentialSkills />
      <AiEra />
      <Skills />
      <Trusted />
    </main>

  );
}

export default App;
